import { Drawer, List } from "@mui/material";
import sizeConfigs from "../../configs/sizeConfigs";

const Sidebar = () => {
    return (
       <Drawer
            variant="permanent"
            sx={{
                width: sizeConfigs.sidebar.width,
                flexShrink: 0
            }}
       >
        <List disablePadding>
            <Toolbar />
            <Stack
                sx={{ width: '100%' }}
            >

            </Stack>
        </List>

       </Drawer>
    );
};

export default Sidebar;
